  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Wallkill
  River National Wildlife Refuge outlines Refuge accomplishments during the 1995 and
  1996 calendar year. The report begins with a summary of the years' highlights and
  weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management planning, public participation,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, manpower programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, and pest control. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  wildlife propagation, and marking and bird banding. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, wildlife observation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, major maintenance,
  and equipment replacement. Cooperative programs and items of interest are provided
  at the end. Refuge brochures, newspaper articles, and field guides are attached\",\n\t\"owner_org\":
